import { Component } from '@angular/core';

@Component({
  selector: 'app-nested-loop-com',
  templateUrl: './nested-loop-com.component.html',
  styleUrls: ['./nested-loop-com.component.css']
})
export class NestedLoopComComponent {
users=[
{name:'anil',phone:'1234'},
{name:'ram',phone:'234'},
{name:'piyush',phone:'567'},
{name:'neha',phone:'9876'}];
}
<!-- <p>nested-loop-com works!</p> -->
<ul *ngFor="let user of users">
<li>{{user.name}}</li>
<li>{{user.phone}}</li>
</ul>
